css:
atom-pane-container {
  position: relative;
  display: flex;
  flex: 1;
  min-width: 0;
  min-height: 0;
}
atom-pane-container atom-pane-axis {
  position: relative;
  display: flex;
  flex: 1;
  min-width: 0;
  min-height: 0;
}
atom-pane-container atom-pane-axis > atom-pane-resize-handle {
  position: relative;
}
atom-pane-container atom-pane-axis > atom-pane-resize-handle:before {
  content: "";
  position: absolute;
  z-index: 3;
}
atom-pane-container atom-pane-axis.vertical {
  flex-direction: column;
}
atom-pane-container atom-pane-axis.vertical > atom-pane-resize-handle {
  border-bottom: none;
}
atom-pane-container atom-pane-axis.vertical > atom-pane-resize-handle:before {
  height: 8px;
  top: -4px;
  left: 0;
  right: 0;
  cursor: row-resize;
}
atom-pane-container atom-pane-axis.horizontal {
  flex-direction: row;
}
atom-pane-container atom-pane-axis.horizontal > atom-pane-resize-handle {
  border-right: none;
}
atom-pane-container atom-pane-axis.horizontal > atom-pane-resize-handle:before {
  width: 8px;
  left: -4px;
  top: 0;
  bottom: 0;
  cursor: col-resize;
}
atom-pane-container atom-pane {
  position: relative;
  display: flex;
  flex: 1;
  flex-direction: column;
  overflow: visible;
  min-width: 0;
  min-height: 0;
}
atom-pane-container atom-pane .item-views {
  flex: 1;
  display: flex;
  min-width: 0;
  min-height: 0;
  position: relative;
}
atom-pane-container atom-pane .item-views .pane-item {
  color: #273a3f;
  background-color: #e6eeef;
}
atom-pane-container atom-pane .item-views > *,
atom-pane-container atom-pane .item-views > atom-text-editor.react > * {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
}
.platform-win32 atom-pane-container atom-pane-axis.vertical > atom-pane-resize-handle {
  cursor: ns-resize;
}
.platform-win32 atom-pane-container atom-pane-axis.horizontal > atom-pane-resize-handle {
  cursor: ew-resize;
}
